import React from 'react';
import  Logo from '../../resources/images/jplogo.svg';

import "./header.scss";


const menu_bar = () => {
    return (
        <nav>
            <ul>
            <svg class="user-nav__icon">
                            <use xLinkHref={logo}></use>
                        </svg>
                <li>about</li>
                <li>portfolio</li>
                <li>blog</li>
                <li>HOME</li>
            </ul>
        </nav>
    );
};

export default menu_bar;
